import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const list = [
    {
        "input_text": "hola",
        "language": "es",
        "output_text": "hello"
    },
    {
        "input_text": "como estas",
        "language": "es",
        "output_text": "how are you"
    },
    {
        "input_text": "bienvenidos",
        "language": "es",
        "output_text": "Welcome"
    }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { list };
  }

  render() {
    return (
      <table>
       {this.state.list.map(item => (
        <tr>
          <td key={item.input_text}>{item.input_text}</td>
          <td key={item.language}>{item.language}</td>
          <td key={item.output_text}>{item.output_text}</td>
        </tr>
      ))}
      </table>
    );
  }
}

export default App;
